import { useEffect, useState } from "react";
import { likedChar, disLikedChar, getMultiplyEpisodeAsync } from "../../redux/rickMortySlice";
import { useGetEpisodeForCharacterQuery } from "../../redux/rickMortyApi";
import { useDispatch, useSelector } from "react-redux";

export const Character = ({ 
  id,
  name, 
  species, 
  gender,  
  location, 
  status,
  episode,
  created, 
  image
}) => {

  const dispatch = useDispatch()
  const { 
    likedCharacters,
    displayMultiplyEpisodes,
    multiplyEpisodesStatus 
  } = useSelector((state) => state.rickMorty)

  const [ clicked, setClicked ] = useState(false)
  const [ liked, setLiked ] = useState(false)

  const dislikeToggle = (id) => {
    setLiked(!liked)
    dispatch(disLikedChar({ charID: id }))
  }

  let idsArr = episode.map(ep => Number(ep.slice(-2).replace('/', '')))
  let ids = idsArr.join(',')

  useEffect(() => {
    dispatch(getMultiplyEpisodeAsync(ids))
  }, [dispatch, ids])

  // const { data: episodes, isSuccess } = useGetEpisodeForCharacterQuery(ids)

  // const episodesName = () => {
  //   if (Array.isArray(episodes)) {
  //     return episodes.map(ep => ep.name).join(', ') 
  //   } else {
  //     return episodes.name
  //   }
  // }

  const episodesName = () => {
    if (Array.isArray(displayMultiplyEpisodes)) {
      return displayMultiplyEpisodes.map(ep => ep.name).join(', ') 
    } else {
      return displayMultiplyEpisodes.name
    }
  }

  // let title = isSuccess ? episodesName() : null

  let title = multiplyEpisodesStatus === 'succeeded' ? episodesName() : null

  // const episodesSeries = () => {
  //   if (Array.isArray(episodes)) {
  //     return episodes.map(ep => ep.episode).join(', ') 
  //   } else {
  //     return episodes.episode
  //   }
  // }
  const episodesSeries = () => {
    if (Array.isArray(displayMultiplyEpisodes)) {
      return displayMultiplyEpisodes.map(ep => ep.episode).join(', ') 
    } else {
      return displayMultiplyEpisodes.episode
    }
  }

  // let series = isSuccess ? episodesSeries() : null

  let series = multiplyEpisodesStatus === 'succeeded' ? episodesSeries() : null

  // const user = users.find(usr => usr.isLogged === true)

  const likeToggle = () => {
    setLiked(!liked)
    dispatch(likedChar({ 
      key: id + 1,
      id,
      name,
      species, 
      gender,
      location, 
      status,
      episode,
      created, 
      image, 
      episodes,
      title, 
      series
    }))
    console.log(id)
  }

  return ( 
    <div className="d-flex justify-content-between my-2 rounded shadow">
      {/* {console.log(displayEpisodes)} */}
      {console.log(episodes)}
      <div className="container">
        <img className="float-start rounded img-fluid my-3 me-3" src={image} alt={name} />
        <div className="mt-3">
          <h5>Name: <span className="sm">{name}</span>, Status: <span className="sm">{status}</span></h5> 
          <div className="d-flex flex-column align-items-end">
            <button className="btn my-3" onClick={() => setClicked(!clicked)}>{!clicked ? 'Show Info' : 'Hide Info'}</button>
            {
              !liked ? 
              <button className={ liked ? 'd-none' : 'btn my-3' } onClick={() => likeToggle()}>❤️ Like</button> :
              <button className={ !liked ? 'd-none' : 'btn my-3' } onClick={() => dislikeToggle(id)}>{'💔 Dislike'}</button>
            }

          </div> 
          <div className={!clicked ? "d-none" : null}>
            <p><span className="fs-5">Species:</span> {species}</p>
            <p><span className="fs-5">Gender:</span> {gender}</p>
            <p><span className="fs-5">Location:</span> {location.name}</p>
            <p><span className="fs-5">Created:</span> {created.slice(0, -14)}</p>
            <div>
              <p className="fs-5">Episode(s):</p>
              <div>
                <p className="ser">series:</p> 
                <p>{series}</p>
              </div>
              <div>
                <p className="ser">title:</p> 
                <p>{title}</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}
